function dbs() {
  const dbname = "leaderboard";
  const requestDB = window.indexedDB.open(dbname);
  requestDB.onupgradeneeded = () => {
    let db = requestDB.result;
    let store = db.createObjectStore("score", {
      keyPath: "id",
      autoIncrement: true,
    });
  };
  requestDB.onsuccess = function (e) {
    let db = requestDB.result;
    let transaction = db.transaction("score", "readwrite");
    let store = transaction.objectStore("score");
    store.put({ score: goal, player: player });
    var request = store.getAll();
    request.onsuccess = function (event) {
      let list = document.querySelector(".tlist");
      list.innerHTML = "<li>list loading</li>";
      let transaction = db.transaction("score", "readwrite");
      list.innerHTML = request.result
        .map((score) => {
          // return `<td><li data-key="${score.id}"</td><span><td>${score.score}</span>${score.player}</li></td>`;
          return `<tr><td>&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp key ${score.id}&nbsp&nbsp&nbsp&nbsp&nbsp</td><span><td>&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp${score.score}&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp</span><td>&nbsp&nbsp&nbsp&nbsp${score.player}&nbsp&nbsp&nbsp&nbsp</td></tr>`;
        })
        .join("\n");
    };
    //store.put({ score: goal, player: "riko" });
    transaction.oncomplete = function () {
      db.close();
    };
  };
}

